function proper(e){return e.replace(/\w\S*/g,function(e){return e.charAt(0).toUpperCase()+e.substr(1).toLowerCase()})}class class_worker{constructor(e,t=!1){let s="."==e.toString().charAt(0);this.elem=s?document.querySelector(e,toString()):document.getElementById(e.toString()),this.debug=t}add(e){return 0==this.elem.classList.contains(e)?(this.elem.classList.add(e),this.debug&&console.log(`Class: [${e}] added.`)):this.debug&&console.log(`Class: [${e}] existed.`),!1}remove(e){return this.elem.classList.contains(e)?(this.elem.classList.remove(e),this.debug&&console.log(`Class: [${e}] removed.`)):this.debug&&console.log(`Class: [${e}] not found.`),!1}delay_add(e,t){var s=this.elem;let o=this.debug;setTimeout(()=>{0==s.classList.contains(e)?(s.classList.add(e),o&&console.log(`Class: [${e}] added by delay after ${t.toString()}ms.`)):o&&console.log(`Class: [${e}] existed after ${t.toString()}ms.`)},t)}delay_remove(e,t){var s=this.elem;let o=this.debug;setTimeout(()=>{s.classList.contains(e)?(s.classList.remove(e),o&&console.log(`Class: [${e}] removed by delay after ${t.toString()}ms.`)):o&&console.log(`Class: [${e}] not found after ${t.toString()}ms.`)},t)}}class workers{constructor(){this.url="https://app.beagletech.org/"}async request(e,t,s={}){let o;return await $.ajax({type:e,url:this.url+t,data:JSON.stringify(s),success:e=>{o=e},error:e=>{console.log(e),o=e}}),o}}const update_time=async()=>{let e=new workers,t=await e.request("GET","apk/time"),s=["label_driver","label_user"];for(let e=0;e<s.length;e++){let o=s[e],l=proper(o.split("_")[1]),r=t[o.split("_")[1]][0],a=t[o.split("_")[1]][1];document.getElementById(o).innerText=`${l}\n最後更新：${r}\n${a}`}};var shown=e=>{let t=new class_worker(e);t.remove("noshow"),t.delay_remove("opc-0",99)};(function(){document.getElementById("user_btn");update_time();try{const e=new URLSearchParams(window.location.search).get("type");""!=e&&null!=e&&setTimeout(()=>{shown(e)},333)}catch(e){}})();